import React,{Component} from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './Components/Header/Header';

class App extends Component {

render(){
  return (
    <div className="App">
   <h1>Woooohhoooooo</h1>
   <Header name="Shawn" fruit="Pineapple"/>
   <Header name="Joe" fruit="Watermelon"/>   
   <Header name="Taylor" fruit="Mango"/>   
   <Header name="Valarie" fruit="Peach"/>

    </div>
  );
}
}

export default App;
